INSERT INTO people (id, title, first_name, last_name, role, department, email, phone, date_of_birth, hire_date, office_location, status, notes, is_complete) VALUES (878, NULL, 'David', 'Polly', 'Faculty', 'ISE', NULL, NULL, NULL, NULL, NULL, 'ACTIVE', 'https://www.yourlawyer.com/defective-medical-devices/medtronic/medtronic-paid-spine-surgeon/ Polly’s billing records revealed that he billed Medtronic $50,000 for lobbying-related costs. According to The Wall Street Journal, Polly traveled to Washington, D.C. and met with members of Congress several times in 2005 and 2006. The Journal also reported that Polly’s “billing rate was $4,750 for an eight-hour day in 2007, and he billed as many as 13,000 minutes a quarter — or 216 hours over three months. In some months, he conducted at least some Medtronic business “nearly every day.” https://assets.si-bone.com/doc/SI-BONE_Patient_Insurance_Authorization_Workbook__9359-060717.pdf Insurance denies SIJ (polly) Report reveals disturbing details of Medtronic’s role in shaping InFuse articles | MinnPost (One of the physician-authors who failed to disclose his financial ties with Medtronic was University of Minnesota spinal surgeon Dr. David Polly, who received a ‘cautionary letter’ last December from the university for violating several of that institution’s conflict-of-interest disclosure requirements.) https://www.mprnews.org/story/2009/07/31/polly-responds Article of Dr. Polly trying to justify his relations with Medtronic and him get 19M a year from them https://www.dotmed.com/news/story/10050 Dr. David Polly Resigns From American Academy of Orthopaedic Surgeons Board due to Medtronic pay out, saying the AAOS when labeling this act as an unnecessary distraction https://www.twincities.com/2011/12/19/spine-surgeon-david-polly-avoids-discipline-for-violating-u-conflict-of-interest-rules/ A University of Minnesota spine surgeon violated university rules by failing to disclose his paid relationship with Fridley-based Medtronic on three occasions — In December 2008, he failed to disclose his consulting relationship with Medtronic on a research poster submitted to the Society of Military Orthopaedic Surgeons for a conference. — In a 2007 paper, he failed to disclose his Medtronic consulting relationship in a paper published in the Journal of Orthopaedic Trauma. — Polly was unable to demonstrate sufficient compliance with disclosure requirements in connection with another study that appeared in the medical journal Spine. U of M the dean of the U’s medical school accepted the review committee’s recommendation and sent a cautionary letter to Polly that asked him to do a better job of disclosing financial conflicts of interest in the future. —- Polly had received nearly $1.2 million in consulting fees from Medtronic over a five-year period. The New England Journal of Medicine last year found that doctors met requirements in making disclosures less than 80 percent of the time, Polly said he satisfied U disclosure requirements in 13 out of 15 publications that were reviewed by the committee. “I certainly beat that average,” he said, “but I didn’t get 100 percent, and I acknowledge that.” stated Polly', false);
