INSERT INTO people (id, title, first_name, last_name, role, department, email, phone, date_of_birth, hire_date, office_location, status, notes, is_complete) VALUES (923, 'DO', 'Kourosh', 'Tavanaiepour', 'Faculty', 'ISE', NULL, NULL, NULL, NULL, NULL, 'ACTIVE', 'My bio Kourosh Tavanaiepour, D.O., is a UF assistant professor of neurosurgery and a UF Health neurosurgeon in Jacksonville, Florida. He is medical director of the UF Health Comprehensive Spine Center and specializes in minimally invasive and complex spine surgery and neurological surgery. Clinical interests include treatment of all types of spine disorders, from chronic back pain to complex conditions such as adult scoliosis. Other conditions treated include intervertebral disc disease, spinal tumors and spine deformities. Board certifications Neurological Surgery American Osteopathic Board of Neurological Surgery Education Minimally Invasive and Complex Spine Fellowship University of Pittsburgh School of Medicine, 2017 Neurological Surgery Residency Hackensack University Medical Center, 2016 Doctor of Osteopathic Medicine Philadelphia College of Osteopathic Medicine, 2010', false);
INSERT INTO people (id, title, first_name, last_name, role, department, email, phone, date_of_birth, hire_date, office_location, status, notes, is_complete) VALUES (924, 'DO', 'Daryoush', 'Tavanaiepour', 'Faculty', 'ISE', NULL, NULL, NULL, NULL, NULL, 'ACTIVE', 'My bio Daryoush Tavanaiepour, M.D., is the chair of the neurosurgery department at the UF College of Medicine – Jacksonville, and a UF Health neurosurgeon in Jacksonville, Florida. He is UF Health''s medical director of the neuro-oncology program in Jacksonville and is medical director of the UF Health Skull Base Center, a multidisciplinary program which treats patients with brain and skull base tumors. He is also the medical director of the Deep Brain Stimulation Program at the UF Health Neuroscience Institute. He specializes in brain and skull-base tumors, deep brain stimulation, and general neurological surgery. Board certifications Neurological Surgery American Board Neurological Surgery Education Skull Base Neurosurgery Fellowship Harvard Medical School, 2012 Functional and Stereotactic Neurosurgery Fellowship Virginia Commonwealth University Health System, 2011 Neurological Surgery Residency Virginia Commonwealth University Health System, 2010 Surgery Internship Virginia Commonwealth University Health System, 2005 Bachelor of Medicine, Bachelor of Surgery University of Otago School of Medicine, 2003', false);
