INSERT INTO people (id, title, first_name, last_name, role, department, email, phone, date_of_birth, hire_date, office_location, status, notes, is_complete) VALUES (1269, 'Patient Advocate', 'Amber', 'Konkler', 'Other', '9', NULL, NULL, NULL, NULL, NULL, 'ACTIVE', '#31810 High BMI pt, wants to be part of advocacy group', false);
INSERT INTO people (id, title, first_name, last_name, role, department, email, phone, date_of_birth, hire_date, office_location, status, notes, is_complete) VALUES (1270, 'Patient Advocate', 'Amber', 'Heitzig', 'Other', '9', NULL, NULL, NULL, NULL, NULL, 'ACTIVE', '3/25/1978, E4289579, 19658 Patient is a high BMI patient with very good results, pain is completely gone, fusion is adequate, and they want to be part of our advocacy group for high BMI patients, please connect and get more involvement.', false);
INSERT INTO people (id, title, first_name, last_name, role, department, email, phone, date_of_birth, hire_date, office_location, status, notes, is_complete) VALUES (1271, 'Patient Advocate', 'Ben', 'Erickson', 'Other', '9', NULL, NULL, NULL, NULL, NULL, 'ACTIVE', 'I wanted to share an update regarding a patient who has expressed strong support for our work. He previously sought surgery from Dr. Polly, who declined to proceed, and had an unsuccessful procedure with Dr. Santos at Fairview. Ultimately, he traveled from Burnsville to Alexandria for surgery with us. Following the procedure, he experienced immediate pain relief and is extremely happy with the outcome. This patient has also read the Star Tribune article and stands firmly on our side. He has expressed a strong interest in becoming active in our advocacy group and supporting our patient ambassadorship program. Additionally, he has provided a testimonial addressing several issues we are currently facing with Fairview and has offered his assistance in this ongoing effort. I will be sharing his testimonial with you soon. Please let me know how we can best utilize his support in our initiatives. He as well mentions how he was suicidal and nobody wanted to help him, so many issues at large in Fairview lawsuits are articulated by the patient himself.', false);
INSERT INTO people (id, title, first_name, last_name, role, department, email, phone, date_of_birth, hire_date, office_location, status, notes, is_complete) VALUES (1272, 'Patient Advocate', 'Virginia', 'Haight', 'Other', '9', NULL, NULL, NULL, NULL, NULL, 'ACTIVE', 'patient advocacy group for individuals with high BMI. This patient was deeply emotional, breaking into tears after I assured her that I could help. She shared how other surgeons had told her she needed to lose 100 pounds before they would even consider surgery. Unfortunately, she gained 80 pounds due to her inability to move—an all-too-common scenario.', false);
INSERT INTO people (id, title, first_name, last_name, role, department, email, phone, date_of_birth, hire_date, office_location, status, notes, is_complete) VALUES (1273, 'Patient Advocate', 'Tasha', 'Neuman', 'Other', '9', 'neumztash04@gmail.com', NULL, NULL, NULL, NULL, 'ACTIVE', NULL, false);
INSERT INTO people (id, title, first_name, last_name, role, department, email, phone, date_of_birth, hire_date, office_location, status, notes, is_complete) VALUES (1274, 'Patient Advocate', 'Kevin', 'Tyner', 'Other', '9', NULL, NULL, NULL, NULL, 'North Carolina', 'ACTIVE', 'patient from North Carolina who has struggled to find help locally due to a high BMI, with most providers telling him there’s nothing they can do.', false);
INSERT INTO people (id, title, first_name, last_name, role, department, email, phone, date_of_birth, hire_date, office_location, status, notes, is_complete) VALUES (1275, 'Patient Advocate', 'Angela', 'Nichols', 'Other', '9', NULL, NULL, NULL, NULL, 'North Carolina', 'ACTIVE', 'from Wilmington, North Carolina. She has a high BMI and, unfortunately, has been advised by local doctors, including those at Duke, that significant weight loss is necessary before any assistance can be offered. Despite seeking help, she has been passed on without any viable options or support provided to her.', false);
