INSERT INTO people (id, title, first_name, last_name, role, department, email, phone, date_of_birth, hire_date, office_location, status, notes, is_complete) VALUES (1280, 'Patient Advocate', 'Andrea', 'Germain', 'Other', '9', NULL, NULL, NULL, NULL, 'Bonita Springs, Florida', 'ACTIVE', 'enduring severe pain, rated 8 to 10 out of 10, and has been on the waiting list for surgery for over a year. The patient is in a dire situation, expressing concerns that without timely intervention, they may become wheelchair-bound by year''s end. Unfortunately, due to the constraints of the Fairview Process, we have been unable to proceed with the necessary treatment. Moreover, other facilities, despite offering a lower level of care, have also declined to accept the patient. It is clear that the patient requires a higher level of care, which is currently being denied. The patient has expressed a strong desire to join an advocacy group and actively participate in seeking solutions.', false);
