INSERT INTO meetings (title, course_id, meeting_date, start_time, end_time, location, subject, presenter_id, cme_credits, expected_attendees, description, notes, status) VALUES ('Hamid Abbasi Medical Sales Accelerator Podcast Recording', (SELECT id FROM courses WHERE course_number = '45' LIMIT 1), '2022-05-25', NULL, NULL, NULL, NULL, (SELECT id FROM people WHERE first_name = 'Hamid Reza' AND last_name = 'Abbasi' LIMIT 1), 0, 0, 'We structure these podcasts as an open conversation…typically before we start recording we will discuss the direction that feels best for the guest. Generally a question I ask before we record to get the thoughts going on a topic is… If you could yell something from a mountain top to all Med Tech (sales, marketing, C-suite, commercial teams, etc)… 1. What do you wish you could teach them? 2. What do you wish they knew? Then we usually base a topic for discussion around their first thoughts.', 'We structure these podcasts as an open conversation…typically before we start recording we will discuss the direction that feels best for the guest. Generally a question I ask before we record to get the thoughts going on a topic is… If you could yell something from a mountain top to all Med Tech (sales, marketing, C-suite, commercial teams, etc)… 1. What do you wish you could teach them? 2. What do you wish they knew? Then we usually base a topic for discussion around their first thoughts.', 'SCHEDULED');
