INSERT INTO meetings (title, course_id, meeting_date, start_time, end_time, location, subject, presenter_id, cme_credits, expected_attendees, description, notes, status) VALUES ('Iran chapter meeting', (SELECT id FROM courses WHERE course_number = '80' LIMIT 1), '2025-01-04', NULL, NULL, NULL, NULL, (SELECT id FROM people WHERE first_name = 'Hamid Reza' AND last_name = 'Abbasi' LIMIT 1), 0, 0, 'I. Introductions & Welcome (5-10 minutes) ● Brief welcome and introduction of participants from the Iranian side. ● Acknowledge Dr. Abbasi''s expertise and express gratitude for his time. ● State the overall meeting objectives: ○ Share current Iranian practices in spine surgery. ○ Gain insights into Dr. Abbasi''s MIS techniques, especially trans-Kambin. ○ Explore the feasibility of establishing MIS spine surgery in Iran. ○ Discuss potential for a Kambin Society in Iran under Dr. Abbasi''s guidance. II. Current Landscape in Iran (15-20 minutes) ● Overview of common spine diseases encountered in Iran. ● Presentation of current surgical approaches and available resources (equipment, facilities, training). ● Highlight challenges and limitations in adopting MIS techniques. III. Dr. Abbasi''s Expertise & Insights (20-30 minutes) ● Dr. Abbasi shares his experience with MIS spine surgery, focusing on: ○ Benefits and advantages of the minimally invasive approach. ○ Overview of the OLLIF and MIS-DTIF procedures. ○ Detailed explanation of his trans-Kambin approach. ○ Key considerations for patient selection. ● Q&A session with Dr. Abbasi, addressing specific questions from the Iranian team. IV. Developing MIS Spine Surgery in Iran (20-30 minutes) ● Phased Approach: Dr. Abbasi provides guidance on a realistic plan: ○ Essential equipment and infrastructure: Prioritize key investments. ○ Training and skill development: Options for workshops, fellowships, or online training. ○ Initial case selection: Identifying suitable candidates for early MIS procedures. ● Kambin Society in Iran: ○ Discuss the structure, objectives, and potential benefits of such a society. ○ Explore Dr. Abbasi''s role in providing mentorship and guidance. V. Next Steps and Closing (5-10 minutes) ● Summarize key takeaways and action items. ● Establish a follow-up communication plan. ● Express gratitude to Dr. Abbasi and all participants', 'I. Introductions & Welcome (5-10 minutes) ● Brief welcome and introduction of participants from the Iranian side. ● Acknowledge Dr. Abbasi''s expertise and express gratitude for his time. ● State the overall meeting objectives: ○ Share current Iranian practices in spine surgery. ○ Gain insights into Dr. Abbasi''s MIS techniques, especially trans-Kambin. ○ Explore the feasibility of establishing MIS spine surgery in Iran. ○ Discuss potential for a Kambin Society in Iran under Dr. Abbasi''s guidance. II. Current Landscape in Iran (15-20 minutes) ● Overview of common spine diseases encountered in Iran. ● Presentation of current surgical approaches and available resources (equipment, facilities, training). ● Highlight challenges and limitations in adopting MIS techniques. III. Dr. Abbasi''s Expertise & Insights (20-30 minutes) ● Dr. Abbasi shares his experience with MIS spine surgery, focusing on: ○ Benefits and advantages of the minimally invasive approach. ○ Overview of the OLLIF and MIS-DTIF procedures. ○ Detailed explanation of his trans-Kambin approach. ○ Key considerations for patient selection. ● Q&A session with Dr. Abbasi, addressing specific questions from the Iranian team. IV. Developing MIS Spine Surgery in Iran (20-30 minutes) ● Phased Approach: Dr. Abbasi provides guidance on a realistic plan: ○ Essential equipment and infrastructure: Prioritize key investments. ○ Training and skill development: Options for workshops, fellowships, or online training. ○ Initial case selection: Identifying suitable candidates for early MIS procedures. ● Kambin Society in Iran: ○ Discuss the structure, objectives, and potential benefits of such a society. ○ Explore Dr. Abbasi''s role in providing mentorship and guidance. V. Next Steps and Closing (5-10 minutes) ● Summarize key takeaways and action items. ● Establish a follow-up communication plan. ● Express gratitude to Dr. Abbasi and all participants', 'SCHEDULED');
